VSCode Version: 1.29.1
OS Version: Windows 10
Steps to Reproduce:

Install aperricone/Harbour
try this code:
proc main()
return 0

#pragma begindump
    if(true && false)
#pragma enddump
setting harbour as language

Does this issue occur when all extensions are disabled?: No

The code between #pragma begindump and #pragma enddump is C language, in harbour.tmlanguage we have:

"c_code": {
			"patterns": [
				{
					"begin": "(?i:^\\s*(#pragma)\\s+(BEGINDUMP))",
					"end": "(?i:^\\s*(#pragma)\\s+(ENDDUMP))",
					"contentName": "source.c.embedded.harbour",
					"beginCaptures": {
						"1": { "name": "meta.preprocessor.pragma.harbour" },
						"2": { "name": "keyword.dump.harbor" }
					},
					"endCaptures": {
						"1": { "name": "meta.preprocessor.pragma.harbour" },
						"2": { "name": "keyword.dump.harbor" }
					},
					"patterns": [
						{
							"include": "source.c"
						},
						{
							"match": "\\b(HB_FUNC|hb_ret[a-z]+|hb_par[a-z]+)\\s*\\(",
							"name": "keyword.connection.harbor"
						}
					]
				}
			]
		}
and in c.json we have:

		"parens": {
			"begin": "\\(",
			"beginCaptures": {
				"0": {
					"name": "punctuation.section.parens.begin.bracket.round.c"
				}
			},
			"end": "\\)",
			"endCaptures": {
				"0": {
					"name": "punctuation.section.parens.end.bracket.round.c"
				}
			},
			"patterns": [
				{
					"include": "$base"
				}
			]
		},
$base obviously referee to source.c, but in this case go to source.harbour, breaking the parser.

It is a reopen for #63498

I'm running the following filter: 
```ts
class LoadedScriptsFilter implements ITreeFilter<BaseTreeItem> {

	private filterText: string;

	setFilter(filterText: string) {
		this.filterText = filterText;
	}

	filter(element: BaseTreeItem, parentVisibility: TreeVisibility): TreeFilterResult<void> {

		if (!this.filterText) {
			return TreeVisibility.Visible;
		}

		if (element.isLeaf()) {
			const name = element.getLabel();
			if (name.indexOf(this.filterText) >= 0) {
				return TreeVisibility.Hidden;
			}
			return TreeVisibility.Visible;
		}
		return TreeVisibility.Recurse;
	}
}
```

And I have an action that does this:
```ts
	this.filter.setFilter(<<some filter text>>);
	this.changeScheduler.schedule(0);
```

Running this action clears the tree completely.
